import React from "react";
import NavBar from "./NavBar";
import Banner from "./Banner";
import MovieDetail from "./Menu/MovieDetail";
import Original from "./Menu/Original";
import Trending from "./Menu/Trending";
import TopRate from "./Menu/TopRate";
import ActionMovies from "./Menu/ActionMovies";
import ComedyMovie from "./Menu/ComedyMovie";
import HorrorMovies from "./Menu/HorrorMovies";
import RomanceMovies from "./Menu/RomanceMovies";
import Documentaries from "./Menu/Documentaries";
function Browse() {
  const detailHandler = (props) => {};
  return (
    <div>
      <NavBar />
      <Banner />
      <Card onDetail={detailHandler}>
        <Original onDetail={detailHandler} onClick={showDetailHandler} />
        <Trending onDetail={detailHandler} onClick={showDetailHandler} />
        <TopRate onDetail={detailHandler} onClick={showDetailHandler} />
        <ActionMovies onDetail={detailHandler} onClick={showDetailHandler} />
        <ComedyMovie onDetail={detailHandler} onClick={showDetailHandler} />
        <HorrorMovies onDetail={detailHandler} onClick={showDetailHandler} />
        <RomanceMovies onDetail={detailHandler} onClick={showDetailHandler} />
        <Documentaries onDetail={detailHandler} onClick={showDetailHandler} />
      </Card>
    </div>
  );
}

export default Browse;
